import React from "react";
import "./header.css";

import { NavLink } from "react-router-dom";
import logo from "../../assets/images/eco-logo.png";
import { Container, Row } from "reactstrap";

const Header = () => {
  return (
    <header>
      <Container>
        <Row>
          <div className="nav_wrapper">
            <div className="logo">
              <img src="" alt="" />
              <div />
              <h1>Multimart</h1>
              <p>Since 1995</p>
            </div>
          </div>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
